import React from 'react';
import {Nav, 
  NavLink, 
  Bars, 
  NavMenu,
  NavBtn, 
  NavBtnLink
} from './NavBarElements';

const Navbar = () => {
  return (
    <>
      <Nav>
        
        <NavMenu >
          <NavLink to="/about" activeStyle>
            Log In
          </NavLink>
          <NavLink to="/services" activeStyle>
            Services
          </NavLink>
          <NavLink to="/contact-us" activeStyle >
            Contact
          </NavLink>
          <NavLink to="/sign-up" activeStyle>
            Sign Up
          </NavLink>
        </NavMenu>
      </Nav>
    </>
  );
};

export default Navbar;
